function ServiceElement({ service }) {
  return <div className="service-element">{service}</div>;
}
function ServicesParag() {
  return (
    <p className="services-parag">
      Thank you for visiting our website! We hope you had a pleasant experience
      and were able to find what you were looking for. It was a pleasure having
      you here and we hope to see you again soon. If you have any feedback or
      suggestions for us, please don't hesitate to reach out. Until next time
    </p>
  );
}
function ServicesSpan() {
  return <p className="services-span">take care and have a great day!</p>;
}
function Buttun() {
  function handleClick() {
    return (
      <div>
        <ServiceElement service="Services" />
        <ServiceElement service="Design a custom logo for your brand" />
        <ServiceElement service="Create a professional profile for your business" />
        <ServiceElement service="Build a stunning website for your company" />
        <ServiceElement service="Design a unique product for your customers" />
        <ServiceElement service="Get a personalized design solution for your business" />
        <ServiceElement service="Request a quote for your design needs" />
        <ServiceElement service="something else" />
      </div>
    );
  }
  return <button onclick={handleClick}>Click me !</button>;
}
export default function Sevices() {
  return (
    <div>
      <Buttun />
      <ServicesParag />
      <ServicesSpan />
    </div>
  );
}
